import ReactDOM from "react-dom";
import { Provider } from "react-redux";

import "./index.css";
import App from "./App";
import uiStore from "./Store/store";

ReactDOM.render(
  <Provider uistore={uiStore}>
    <App />
  </Provider>,
  document.getElementById("root")
);
